        return 0 <= pos[0] < n and 1 <= pos[1] < m and (0 <= pos[2] < k)

    def CPU_status(pos, number):
        return safe(pos) and super_computer[pos[0]][pos[1]][pos[2]] == number

    def critical(x, y, z):
        if super_computer[x][y][z] != '0':
            current = [x, y, z]
            for i in range(3):
                parent = current.copy()
                parent[i] -= 1
                if CPU_status(parent, '1'):
                    for j in range(3):
                        (child, alt) = (current.copy(), parent.copy())
                        child[j] += 1
                        alt[j] += 1
                        if CPU_status(child, '1') and (not CPU_status(alt, '1') or j == i):
                            return 1
        return 0
    crit = 0
    for i in range(n):
        for j in range(m):
            for k in range(k):
                crit += critical(i, j, k)
    return crit

